import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Button, Popover, PopoverHeader, PopoverBody, Container, Row, Col
      } from 'reactstrap';

import QR from './images/cardQR.png';
import FadedHeader from './FadedHeader.js';
import typewriter from './images/typewriter.jpeg';
import Accordion from 'react-bootstrap/Accordion';
import Card from 'react-bootstrap/Card';

export default class Contact extends Component  {



  render() {
      return (

        <div>


          <Row>
              <Col>
                <img className="bg-contact"
                    src={typewriter}
                />
              </Col>

              <Col className="center">
                <h2 className="contactStyle"> Currently : Technical Support Engineer </h2>
                <h2>
                  <a className="center" target="_blank" rel="noopener noreferrer" href='mailto:scott.lau.stubbs@gmail.com?subject=What a cool website !&body=I found your email through your website.'> Send me an Email !</a>
                </h2>


                <Row className="center">

                  <img
                      src={QR}
                  />

                </Row>
              </Col>

          </Row>



        </div>
      );
  }
}
